another use cases…. untuk extension:
misalnya kita sering make style TextStyle tertentu dalam mebuat sebuah text, 
misal `Text(“hello”, style: TextStyle(….))` dan yg berbeda cuma text content nya saja…

nah ini kita bisa extends string… 
```extension StringToText on String {
  Text toHeading({Color color = App.textColor}) {
    return Text(
      this,
      style: App.textStyle(fontSize: 20, fontWeight: FontWeight.bold,),
    );
  }

  Text toTitle({Color color = App.textColor}) {
    return Text(
      this,
      style: App.textStyle(fontSize: 18, fontWeight: FontWeight.bold,),
    );
  }

  Text toSubTitle({Color color = App.textColor}) {
    return Text(
      this,
      style: App.textStyle(fontSize: 16, fontWeight: FontWeight.bold,),
    );
  }
}```

